css:
.editor-colors {
  background-color: #201632;
  color: #b4a1d6;
}
.editor {
  background-color: #201632;
  color: #b4a1d6;
}
.editor .wrap-guide {
  background-color: #181026;
}
.editor .indent-guide {
  color: #373b41;
}
.editor .invisible-character {
  color: #373b41;
}
.editor .gutter {
  background-color: #181026;
  color: #b4a1d6;
}
.editor .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #b4a1d6;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #b4a1d6;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #675a80;
}
.editor .invisible {
  color: #b4a1d6;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #2f1f4a;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #675a80;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #675a80;
}
.entity.name.type {
  color: #ffb899;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #dbd36e;
}
.keyword {
  color: #7450b6;
}
.keyword.control {
  color: #7450b6;
}
.keyword.operator {
  color: #b4a1d6;
}
.keyword.other.special-method {
  color: #31a7c9;
}
.keyword.other.unit {
  color: #db8958;
}
.storage {
  color: #7450b6;
}
.constant {
  color: #db8958;
}
.constant.character.escape {
  color: #74cab4;
}
.constant.numeric {
  color: #db8958;
}
.constant.other.color {
  color: #74cab4;
}
.constant.other.symbol {
  color: #dbd36e;
}
.variable {
  color: #e2454b;
}
.variable.interpolation {
  color: #d32128;
}
.variable.parameter.function {
  color: #b4a1d6;
}
.invalid.illegal {
  background-color: #e2454b;
  color: #201632;
}
.string {
  color: #dbd36e;
}
.string.regexp {
  color: #74cab4;
}
.string.regexp .source.ruby.embedded {
  color: #db8958;
}
.string.other.link {
  color: #e2454b;
}
.punctuation.definition.comment {
  color: #675a80;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #b4a1d6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #31a7c9;
}
.punctuation.definition.bold {
  color: #ffb899;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #7450b6;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d32128;
}
.support.class {
  color: #ffb899;
}
.support.function {
  color: #74cab4;
}
.support.function.any-method {
  color: #31a7c9;
}
.entity.name.function {
  color: #31a7c9;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffb899;
}
.entity.name.section {
  color: #31a7c9;
}
.entity.name.tag {
  color: #e2454b;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #db8958;
}
.entity.other.attribute-name.id {
  color: #31a7c9;
}
.meta.class {
  color: #ffb899;
}
.meta.link {
  color: #db8958;
}
.meta.require {
  color: #31a7c9;
}
.meta.selector {
  color: #7450b6;
}
.meta.separator {
  background-color: #373b41;
  color: #b4a1d6;
}
.none {
  color: #b4a1d6;
}
.markup.bold {
  color: #db8958;
  font-style: bold;
}
.markup.changed {
  color: #7450b6;
}
.markup.deleted {
  color: #e2454b;
}
.markup.italic {
  color: #7450b6;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #31a7c9;
}
.markup.inserted {
  color: #dbd36e;
}
.markup.list {
  color: #e2454b;
}
.markup.quote {
  color: #db8958;
}
.markup.raw.inline {
  color: #dbd36e;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #dbd36e;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
